import React from 'react';
import { NavLink } from 'react-router-dom';

export const About = () => {
    return (
        <>
            <h1>i'm About</h1>
            <NavLink to='./Home.jsx'>Home</NavLink>
          <NavLink to='./About'>About</NavLink>
          <NavLink to='./Contact'>Contact</NavLink>
        </>
    )
}

export default About;
